import React from "react"
import {NavLink} from "react-router-dom"
import styled from "styled-components"
const Navbar = ()=>{
    const links = [
        {
            to:"/",
            title:"Home",
            exact:true
        },

        {
            to:"/login",
            title:"Login",
            exact:false
        },
        {
            to:"/branch",
            title:"Branch",
            exact:false
        },
    ];
    return(
        <>
        {

            links?.map(({to,title,exact})=>(
            <Wrapper>
                <NavLink exact={exact} to={to} key = {to}>{title}</NavLink>
            </Wrapper>
            ))
        }
        </>
    )
}

export default Navbar                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                               

const Wrapper = styled.div`
    display:flex;
    background-color: #3487cf;
    color: blue;
    justify-content: space-between;
    border:1px solid;
`;
